import React from 'react';
import PasswordReset from '../Components/PasswordReset.jsx';
import { Container, H2, Paper } from '@material-tailwind/react'; // Importer les éléments correspondants de Material Tailwind

function PasswordResetPage() {
  return (
    <Container>
      <div className="py-12">
        <H2 color="gray" className="text-3xl font-extrabold text-gray-900 text-center">Réinitialisation du mot de passe</H2>
      </div>
      <div className="mt-8 mx-auto w-full max-w-md">
        <Paper elevation="3" className="bg-white p-8 shadow-lg rounded-lg">
          <PasswordReset />
        </Paper>
      </div>
    </Container>
  );
}

export default PasswordResetPage;
